import App from './App.vue'

createApp(App).mount('#app')

const routes = [
    {path: '/login', component: LoginComponent},
    {path: '/home', component: HomeComponent}
]

const router = new VueRouter({
    routes // shartes for routes: routes
})

new Vue ({
    router,
    render:a => h(App),
}).$mount('#app')
